import React, { Component } from 'react'
import pybot from '../Components/public/image/pybot.png';
import Opencv from '../Components/public/image/Snapshot.png';
import NightMares from '../Components/public/image/menu3.png';
import RecorderMaintainer from '../Components/public/image/de.png';
import WordPress from '../Components/public/image/blog.png';
import Password from '../Components/public/image/bute.png';




class Portfolio extends Component {
    render() {
        return (

            <section className="projects">
                  <h1 id='Portfolio'>Portfolio</h1>
                  <p>Some of the projects done by me including my blog.</p>

                    <div className="container">
                        <a href="https://github.com/amitkumar-creator/PyBot-A-ChatBot-For-Answering-Python-Queries-Using-NLP"><img src={pybot} width="200" height="200" alt="Pybot"/><p>Pybot:Chat Based on</p></a>
                        <a href="https://github.com/amitkumar-creator/Drowsiness-monitoring-Using-OpenCV-Python"><img src={Opencv} width="200" height="200" alt="Pybot"/><p>-monitoring-Using-OpenCV-Python</p></a>
                        <a href="https://github.com/amitkumar-creator/NightMares-"><img src={NightMares} width="200" height="200" alt="Pybot"/><p>Nigthmares FPS</p></a>
                    </div>

                    <div className="container">
                        <a href="https://github.com/amitkumar-creator/Student-Record-Maintainer-In-PyQT5"><img src={RecorderMaintainer} width="200" height="200" alt="Pybot"/><p>Recorder Maintainer</p></a>
                        <a href="https://amitkumar.ast.wordpress.com/"><img src={WordPress} width="200" height="200" alt="Pybot"/><p>Wordpress Blog</p></a>
                        <a href="https://github.com/amitkumar-creator/Brute-Forcing-password-in-python"><img src={Password} width="200" height="200" alt="Pybot"/><p>Password Cracker</p></a>
                    </div>


            </section>
        )
    }
}

export default Portfolio
